import "core-js/modules/es6.object.keys";
import "core-js/modules/es6.function.name";
import "core-js/modules/web.dom.iterable";
import Vue from 'vue';
import { parse } from '@/utils/webpack-key-path';

var FilterContext = require.context('./', true, /\.filters\.ts$/);

var FilterKeys = FilterContext.keys();
FilterKeys.forEach(function (keyPath) {
  var file = FilterContext(keyPath);
  var filters = file.default || file;
  var parsed = parse(keyPath);

  if (/(#)/.test(parsed.name)) {
    return;
  }

  Object.keys(filters).forEach(function (name) {
    Vue.filter(name, filters[name]);
  });
});
